  }
credentials:
  folder: {
    }
  providerImpl: {
    }
  system:
    domainCredentials:
    - domain: {
        }
  user: {
    }
jenkins:
  authorizationStrategy: "cloudBeesRoleBasedAccessControl"
  crumbIssuer:
    standard:
      excludeClientIPFromCrumb: false
  disableRememberMe: false
  disabledAdministrativeMonitors:
  - "hudson.util.DoubleLaunchChecker"
  labelAtoms:
  - name: "agent"
  - name: "built-in"
  - name: "cloud"
  log: {
    }
  markupFormatter: "plainText"
  mode: NORMAL
  noUsageStatistics: true
  nodeMonitors:
  - "architecture"
  - "clock"
  - diskSpace:
      freeSpaceThreshold: "1GiB"
      freeSpaceWarningThreshold: "2GiB"
  - "swapSpace"
  - tmpSpace:
      freeSpaceThreshold: "1GiB"
      freeSpaceWarningThreshold: "2GiB"
  - "responseTime"
  nodes:
  - permanent:
      labelString: "cloud"
      launcher: "inbound"
      name: "agent"
      remoteFS: "/home/developer/cloud-agent"
      retentionStrategy: "always"
  numExecutors: 0
  primaryView:
    masters:
      columns:
      - "status"
      - "weather"
      - "jobName"
      - "manageMaster"
      - "totalJobsViewColumn"
      - "queueSizeViewColumn"
      - "jenkinsVersionViewColumn"
      - "listSelectionColumn"
      jobFilters:
      - "connectedMasterViewFilter"
      name: "Controllers"
      recurse: true
  projectNamingStrategy: "standard"
  quietPeriod: 5
  remotingSecurity:
    enabled: true
  scmCheckoutRetryCount: 0
  securityRealm:
    local:
      allowsSignup: false
      enableCaptcha: false
      users:
      - id: "terralogic"
        name: "Channammarani Biradar"
        properties:
        - "consoleUrlProvider"
        - "viewsTabBar"
        - "blueSteelRedirectOptOutProperty"
        - myView:
            viewsTabBar: "standard"
        - preferredProvider:
            providerId: "default"
        - "timezone"
        - "experimentalFlags"
        - mailer:
            emailAddress: "sbiradarchannamma@gmail.com"
        - "apiToken"
  slaveAgentPort: 50000
  updateCenter:
    sites:
    - id: "core-oc-traditional-offline"
      url: "file:/var/cache/cloudbees-core-oc/war/WEB-INF/plugins/update-center.json"
    - id: "cap-core-oc-traditional"
      url: "https://jenkins-updates.cloudbees.com/update-center/envelope-core-oc-traditional/update-center.json"
  views:
  - masters:
      columns:
      - "status"
      - "weather"
      - "jobName"
      - "manageMaster"
      - "totalJobsViewColumn"
      - "queueSizeViewColumn"
      - "jenkinsVersionViewColumn"
      - "listSelectionColumn"
      jobFilters:
      - "connectedMasterViewFilter"
      name: "Controllers"
      recurse: true
  - all:
      name: "all"
  viewsTabBar: "standard"
cloudbees-monitoring: {
  }
advisor:
  acceptToS: true
  email: "sbiradarchannamma@gmail.com"
  excludedComponents:
  - "AgentsSystemConfiguration"
  - "AgentsJVMProcessSystemMetricsContents"
  - "AgentsConfigFile"
  - "ConfigFileComponent"
  - "SlaveLogs"
  - "OtherConfigFilesComponent"
